import "./App.css";
import TodoList from "./my-component/TodoList";
import { tasksContext } from "../context/TaskContext";
import { v4 as uuidv4 } from "uuid";
import { useState } from "react";

function App() {
  const Tasks = [
    {
      id: uuidv4(),
      title: "زيد الخير الحداد",
      taskDetails: "يجب إنجاز هذا المشروع خلال يومين",
      isDone: false,
    },
    {
      id: uuidv4(),
      title: "أحمد عرقسوسي",
      taskDetails: "يجب إنجاز هذا المشروع خلال يومين",
      isDone: false,
    },
  ];
  // const { todo, setTodo } = useContext(tasksContext);
  const [todo, setTodo] = useState(Tasks);
  return (
    <div className="App">
      <tasksContext.Provider value={{ todo, setTodo }}>
        <TodoList />
      </tasksContext.Provider>
    </div>
  );
}

export default App;
